contracts/calalili.sol.content:
//SPDX-License-Identifier:MIT
pragma solidity^0.8.0;

// Callee
contract A
{
   uint256  public x;
   function foo(uint256 _x) public
   {
             x = _x;
   }
}
// Caller
contract CallA
{
    uint256 public x;
    function  callfoo(address _a) public
    {
       (bool success,) = _a.call(abi.encodeWithSignature("foo(uint256)", 666));
                  require(success, "Call was not successful");
    }
    function  Dcallfoo(address _a) public
    {
       (bool success,) = _a.delegatecall(abi.encodeWithSignature("foo(uint256)", 999));
                  require(success, "DDDDDDDCall was not successful");
    }
}

